      <Content>
        <img src={logo} alt="GoBarber" />

        <form>
          <h1>Fa√ßa seu logon</h1>
          <input type="text" placeholder="E-mail" />
          <input type="password" placeholder="Senha" />

          <button>Entrar</button>

          <a href="#">Esqueci minha senha</a>
        </form>
      </Content>
      <Background />
    </Container>
  );
};

export default SignIn;
